import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import celebrity from "../celebrity.js";
import Avatar from "./Avatar";

function appContent() {

  return ( < div > < Header / > < body > < h1 className = "heading" > My Contacts < /h1> <
    Avatar image = "https://i.pinimg.com/564x/55/b5/3a/55b53a05427f3513e0fe27e588a322da.jpg" / > <
    Note name = {
      celebrity[0].name
    }
    image = {
      celebrity[0].image
    }
    tel = {
      celebrity[0].tel
    }
    email = {
      celebrity[0].email
    }
    / > <
    Note name = {
      celebrity[1].name
    }
    image = {
      celebrity[1].image
    }
    tel = {
      celebrity[1].tel
    }
    email = {
      celebrity[1].email
    }
    / > <
    Note name = {
      celebrity[2].name
    }
    image = {
      celebrity[2].image
    }
    tel = {
      celebrity[2].tel
    }
    email = {
      celebrity[2].email
    }
    / ></body > <
    Footer / > < /div>);
  }

  export default appContent;
